/* eslint-disable no-unused-vars */
import React from 'react'
import axios from 'axios'
import { useEffect,useState } from 'react'

// import { response } from 'express'

function Bookslist() {
 const [books,setbooks] = useState([])
 
 const fetchData = React.useCallback(() => {
    axios({
      "method": "GET",
      "url": "http://localhost:2000/api/books/",
      "headers": {}, "params": {}
    })
      .then((response) => {

        const APIResponse = response.data // This is response data from AXIOS

        console.log("response: ", APIResponse.data) // This is response data from API

        setbooks(APIResponse.data) // Only Response from API is set in state

      })
      .catch((error) => {
        console.log(error)
      })
  }, [])

  React.useEffect(() => {
    fetchData()
  }, [fetchData])

  return (
    <div>
    <h1>{books.map(book =>{
        return <pre>{book}</pre>
    })}</h1>
    <button onClick={()=>setbooks("bye")}>click</button>
    </div>
  )
}

export default Bookslist
